import React from 'react'
import styled from 'styled-components';

const Form = styled.div`
  font-family: 'Mulish';
  font-style: normal;
  font-weight: 700;
  font-size: 16px;
  line-height: 20px;
`;

const FormInner = styled.div`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  padding: 14.56px 21.84px 5.46px;
  gap: 21.84px;

  position: relative;
  width: 446px;
  height: 219.21px;
  background: #FFFFFF;
  box-shadow: 0px 2.73px 7.28px rgba(132, 132, 134, 0.24);
  border-radius: 14.56px;
`;

const Title = styled.div`
  text-align: center;
  flex: none;
  order: 0;
  align-self: stretch;
  flex-grow: 0;
`;

const Label = styled.label`
  display: flex;
  flex-direction: row;
  align-items: center;
  padding: 0px;
  gap: 4.85px;
  width: 402.32px;
  height: 21px;
`;

const input = styled.input`
  box-sizing: border-box;
  display: flex;
  flex-direction: row;
  align-items: flex-start;
  padding: 9.70286px;
  gap: 12.13px;
  width: 402.32px;
  height: 48.51px;
  background: #FFFFFF;
  border: 1.21286px solid #2459AD;
  border-radius: 9.70286px;
`;


function SearchWarranty(props) {
  return (props.trigger) ? (
    <Form>
        <FormInner>
          <Title>Tra cứu thông tin bảo hành</Title>
        </FormInner>
    </Form>
  ) : "";
}

export default SearchWarranty
